import React from 'react';
import logo from '../../assets/logo.svg';
import './Blog.css';

function Blog() {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
            </header>
        </div>
    );
}

export default Blog;
